def knight_min_health(dungeon):
    dp = [[0] * len(dungeon) for _ in range(len(dungeon))]
    dp[0][0] = dungeon[0][0]
    dp[0][1] = max(0, dungeon[0][1] + dp[0][0])
    dp[1][0] = max(0, dungeon[1][0] + dp[0][0])
    dp[1][1] = max(0, dungeon[1][1] + dp[0][1])
    for i in range(2, len(dungeon)):
        dp[i][0] = max(0, dp[i-1][0] + dungeon[i][0])
        dp[i][1] = max(0, dp[i-1][1] + max(dungeon[i][1], 0))
    return max(dp[-1])

