        maze.append(input())
    directions = [(0, 1), (0, -1), (1, 0), (-1, 0)]
    def is_valid(x, y):
        return 0 <= x < r and 0 <= y < c
    def is_odd(x, y):
        return (x + y) % 2 == 1
    def remove_walls(x, y):
        for dx, dy in directions:
            nx, ny = x + dx, y + dy
            if not is_valid(nx, ny) or maze[nx][ny] == '/':
                continue
            if is_odd(nx, ny):
                maze[x][y] = '/'
                maze[nx][ny] = '\\'
            else:
                maze[x][y] = '\\'
                maze[nx][ny] = '/'
    def count_odd(x, y):
        count = 0
        for dx, dy in directions:
            nx, ny = x + dx, y + dy
            if not is_valid(nx, ny) or maze[nx][ny] == '/':
                continue
            if is_odd(nx, ny):
                count += 1
        return count
    for i in range(r):
        for j in range(c):
            if maze[i][j] == '/':
                remove_walls(i, j)
    count = 0
    for i in range(r):
        for j in range(c):
            if maze[i][j] == '\\':
                count += count_odd(i, j)
    print(count)


